@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://example.com/ATM#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

atm:ATM rdf:type owl:Class .

atm:providesMultiLanguageSupport rdf:type owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range xsd:integer .

atm:ATM owl:Restriction owl:onProperty atm:providesMultiLanguageSupport ;
  owl:hasValue 5^^xsd:integer ;
  owl:qualifiedCardinality 1 .
